import React from "react"

class button extends React.Component
{
    constructor()
    {
        super()
        this.state = 
        {
            count : 0
        }
    }

    addCount = () =>
    {
        this.setState(
            {
                count : this.state.count + 1
            }
        )
    }

    render()
    {
        return(
            <div>
                <button onClick={this.addCount}> Click Here! </button>
                <p>Counting = {this.state.count}</p>
            </div>
        )
    }
}

export default Button
